import {filter} from './search';

function Home({searchProducts}) {
  const { data: products } = useFetchProduct("https://dummyjson.com/products");

  return (
    <div className="home">

      {/* <div className="products_container"> */}
      {products && <AllProduct products={filter(products,searchProducts)} />}

      {/* </div> */}

    </div>
  )
}
export default Home;
